import React from 'react';


const DisplayEducation = (props) => {
    const {education} = (props);

    return (
        <div>
            <p>School name</p> 
            <ul>{education.school}</ul>
            <ul>{education.title}</ul>
            <ul>{education.startDate}</ul>
            <ul>{education.endDate}</ul>
        </div>
    );
}


export default DisplayEducation;
